script: |
  super -f text -I q10792.spq | sort > q10792.out

inputs:
  - name: q10792.spq
    data: |
      SELECT DISTINCT 89 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE ( ( + col2 + - col2 ) BETWEEN + 51 * - col1 * - ( - 40 ) AND col2 );
  - name: tab0

outputs:
  - name: q10792.out
    data: |
      89
